import React from "react";
import { CardBody, Card, Container } from "reactstrap";
// import AntTable from "../tables/AntTable";

function AllStudent() {
  return (
    <>
      <Container className="mt--6">
        <Card>
          <CardBody>
            {/* <AntTable
                                columns={columns}
                                data={staffList}
                                pagination={true}
                                exportFileName="StaffDetails"
                              /> */}
          </CardBody>
        </Card>
      </Container>
    </>
  );
}

export default AllStudent;
